"use strict";var myLink=document.getElementById("btnRegister-js");function stopPadrao(e){e.preventDefault()}var divLogin=document.querySelector(".cont"),divLoad=document.querySelector(".loading");function showLoading(){divLogin.style.display="none",divLoad.style.display="block"}function showAnswer(e){setTimeout(function(){divLoad.style.display="none",divLogin.innerHTML=e.data,divLogin.style.display="block"},2e3)}function funcRegister(){showLoading(),axios.get("/register").then(function(e){showAnswer(e)})}myLink.addEventListener("click",funcRegister),myLink.addEventListener("click",stopPadrao);